  {
    super(props);

  }
  componentDidMount() {
    var indDB = window.indexedDB || window.mozIndexedDB || window.webkitIndexedDB || window.msIndexedDB;
    var db;
    var dbReq = indexedDB.open('gallery', 1);

    dbReq.onupgradeneeded = (event) => {
      // Зададим переменной db ссылку на базу данных
      db = event.target.result;
      // Создадим хранилище объектов с именем notes.
      let notes = db.createObjectStore('notes', {autoIncrement: true});
    }
    dbReq.onsuccess = (event) => {
      db = event.target.result;
      let otherNote = db.createObjectStore('other', {autoIncrement: true});
    }
    dbReq.onerror = (event) => {
      alert('error opening database ' + event.target.errorCode);
    }

}
